import React from "react";
import "../containers/Home.css";
import {Button, Checkbox, FormGroup, FormControlLabel, Typography} from '@material-ui/core';
import { LinkContainer } from "react-router-bootstrap";
import Image from '../img/dog.jpg';



export default function Step1() {
  return (
    <div className="Step1">
      <div className="lander">
      <img src={Image} alt="Dog" />
        <Typography variant="h3">Stap 1</Typography>
        <FormGroup column>
        <FormControlLabel
          control={
            <Checkbox
              value="checkedA"
              inputProps={{ 'aria-label': 'Checkbox A' }}
              color="primary"
            />
          }
            label="Requirement"
        />
        <FormControlLabel
          control={
            <Checkbox
              value="checkedA"
              inputProps={{ 'aria-label': 'Checkbox A' }}
              color="primary"
            />
          }
            label="Requirement 2"
        />
        </FormGroup>
        <Typography variant="body1">Klik op de knop volgende</Typography>
        <LinkContainer to="/step2">
          <Button variant="contained" color="primary">Next</Button>
        </LinkContainer>
      </div>
    </div>
  );
}
